import { PostPreview } from '../components/postPreview'
import { posts } from '../utils/getAllPosts'

export default function IndexPage() {
  return (
    <>
      <section></section>
      {posts.slice(0, 1).map(post => (
        <PostPreview key={post.link} post={post} />
      ))}
    </>
  )
}

